import React from "react";
import { Link } from "react-router-dom";
const Events = () => {
  return (
    <section className="event">
      <ul class="nav justify-content-center event__tabs">
        <li class="nav-item event__tab event__tab--1">
          <Link class="nav-link active" href="#">
            الفعاليات الحالية
          </Link>
        </li>
        <li class="nav-item event__tab  event__tab--2">
          <Link class="nav-link" href="#">
            الفعاليات السابقة
          </Link>
        </li>
      </ul>
    </section>
  );
};

export default Events;
